import React from 'react';
//import logo from '../../img/logo-187x66.png';
import classes from './Home.module.css'
import BlockHead from "../BlockHead/BlockHead";
import BannerHead from '../../img/banner_img.png'

let strong = "<strong>";
let text = "we conceptualize," + strong  + "design and develop apps" + strong +" that people love";


const  Home = () =>{
    return (
        <div className={classes.block}>
            <BlockHead  text={text} img={BannerHead}/>

        </div>
    );
};


export default Home;
